script: |
  super -f text -I q9292.spq | sort > q9292.out

inputs:
  - name: q9292.spq
    data: |
      SELECT - COUNT ( * ) FROM tab2 (FORMAT parquet) AS cor0 WHERE col0 * col1 * - ( - col1 ) NOT IN ( + 33, col0, - - col1 * + + ( - col1 ) );
  - name: tab2

outputs:
  - name: q9292.out
    data: |
      -3
